import { NavLink } from "react-router-dom";
import classes from "./MainNavigation.module.css";

const MainNavigation = () => {
  return (
    <ul className={classes.nav}>
      <NavLink to="/">
        <a>Home</a>
      </NavLink>
      <li>
        <a>About Me</a>
      </li>
      <li>
        <a>Projects</a>
      </li>
      <li>
        <a>Contact</a>
      </li>
    </ul>
  );
};

export default MainNavigation;
